import styled from "styled-components";
import img from "../../images/meme.jpg";

export const Back = styled.div`
  height: 100vh;
  width: 100vw;
  backgroundimage: ${{ img }};
  font-size: 48;
  font-family: "Oswald", sans-serif;
  font-weight: bold;
  color: #096192;
`;
